import React, { Fragment } from 'react';
import Navbar from '../components/Navbar'

function Layout({children}) {
    return (
        <Fragment>
            <Navbar>
                {children}
            </Navbar>
            <div>
                Jacek
            </div>
        </Fragment>
        
    );
}

export default Layout;
